    public function actualizaPrecios()
    {   
        ini_set('max_execution_time', 300); // Ajusta el límite de tiempo a 300 segundos o más
        $urlBase = 'https://www.mundoblanc.com/comprar';
        $client = new Client();

        $allspanElements = []; // Array para almacenar todos los elementos h3
        $resultado = [0,0];

        for ($i = 1; $i <= 26; $i++) {
            $url = $urlBase . '?page=' . $i;
            $crawler = $client->request('GET', $url);

            // Obtener todos los elementos h3 de la página actual y agregarlos al array general
            $spanElements = $crawler->filter('span.cfpn1d')->each(function ($node) {
                return $node->text();
            });

            $allspanElements = array_merge($allspanElements, $spanElements);
        }
        for($i=0;$i<count($allspanElements);$i++){
            $producto = Producto::find($i + 1);
            $cadenaLimpia = str_replace(['€'], '', $allspanElements[$i]);
            $cadenaLimpia = str_replace([','], '.', $allspanElements[$i]);

            $numeroDecimal = floatval($cadenaLimpia);
            $producto->precio = $numeroDecimal;
            $exito = $producto->save();
            if($exito)
                $resultado[0]++;
            else
                $resultado[1]++;
        }
        return view('productos.scrap',["resultado"=>$resultado]);
    }

