    function actualizaColor($color,&$resultado){
        ini_set('max_execution_time', 300); // Ajusta el límite de tiempo a 300 segundos o más
        $urlBase = 'https://www.mundoblanc.com/comprar?Color=' . $color;
        $client = new Client();

        $allElements = [];

        $numeroElementos = 0;

        $pagina = 1;
        do{
            $url = $urlBase . '&page=' . $pagina;
            $crawler = $client->request('GET', $url);

            $elements = $crawler->filter('h3')->each(function ($node) {
                return $node->text();
            });
            
            $numeroElementos = count($elements);

            $allElements = array_merge($allElements, $elements);
            ++$pagina;
        }
        while($numeroElementos>0);

        for($i=0;$i<count($allElements);$i++){
            
            $productoEncontrado = Producto::where('nombre', $allElements[$i])->first();
            $productoEncontrado->color = $color;
            $exito = $productoEncontrado->save();
            if($exito)
                $resultado[0]++;
            else
                $resultado[1]++;
        }
        // return $resultado;
    }


    public function actualizaAcabado(){
        ini_set('max_execution_time', 300); // Ajusta el límite de tiempo a 300 segundos o más
        $registros = Producto::all();
        $resultado = [0,0];
        $opciones = ["BRILLO","MATE","LAPADO","PULIDO","SATINADO"];
        $errores = [];
        $cuenta = 0;

        // Iterar sobre cada registro y actualizar el campo "color"
        foreach ($registros as $registro) {
            $cambiado = false;
            foreach($opciones as $opcion){
                if(strpos($registro->nombre, $opcion) == true){
                    $registro->acabado = $opcion;
                    $exito = $registro->save();
                    if($exito)
                        $resultado[0]++;
                    else{
                        $resultado[1]++;
                        $errores[count($errores)] = $cuenta;
                    }
                    $cambiado = true;
                }
            }
            if($cambiado == false){
                $resultado[1]++;
                $errores[count($errores)] = $cuenta;
            }
            ++$cuenta;
        }
        return view('productos.scrap',["resultado"=>$resultado,"errores"=>$errores]);
    }

