    public function actualizaMedida(){
        ini_set('max_execution_time', 300); // Ajusta el límite de tiempo a 300 segundos o más
        $registros = Producto::all();
        $resultado = [0,0];
        $errores = [];
        $cuenta = 0;
        $patron = '/(\d+[Xx]\d+)/';

        // Iterar sobre cada registro y actualizar el campo "color"
        foreach ($registros as $registro) {
            $cambiado = false;

            if (preg_match($patron, $registro->nombre, $coincidencias)) {
                // La medida se encuentra en $coincidencias[0]
                $medida = $coincidencias[0];
                $registro->medida = $medida;
                $exito = $registro->save();
                if($exito)
                    $resultado[0]++;
                else{
                    $resultado[1]++;
                    $errores[count($errores)] = $cuenta;
                }
                $cambiado = true;
            } else {
                $resultado[1]++;
                $errores[count($errores)] = $cuenta;
            }
            ++$cuenta;
            
        }
        return view('productos.scrap',["resultado"=>$resultado,"errores"=>$errores]);
        
    }

