    public function descargarPDF($enlace){
        
        $urlArchivoExterno = $enlace;

        // Extraer el nombre del archivo de la URL
        $nombreArchivo = pathinfo(parse_url($enlace, PHP_URL_PATH), PATHINFO_BASENAME);

        // Descargar el archivo desde la URL
        $contenidoArchivo = file_get_contents($urlArchivoExterno);

        // Guardar el archivo en storage
        $rutaArchivoLocal = 'pdf/' . $nombreArchivo;

        // Almacenar el archivo en el sistema de archivos de Laravel
        Storage::put($rutaArchivoLocal, $contenidoArchivo);

        // Obtener la ruta completa del archivo local
        $rutaCompleta = storage_path("app/$rutaArchivoLocal");

        // Verificar si el archivo se descargó correctamente
        if (file_exists($rutaCompleta) && is_file($rutaCompleta)) {
            // Descargar el archivo
            return response()->download($rutaCompleta, $nombreArchivo);
        } else {
            // Manejar el caso en el que la descarga falló
            return false;
        }
    }




